                                                                                                                                                                                                                                       (125, 2, 0, 'page', 'Privacy Policy', 'Privacy Policy', 'privacy-policy', '<div>\r\n<h2> </h2>\r\n\r\n<div>\r\n<h1>Privacy Policy</h1>\r\n\r\n<div>\r\n<h2>The Website</h2>\r\n\r\n<p><a href=\"https://carquest.com\">CarQuest</a><a href=\"carquest.com\">t</a> and its owners take a proactive approach to user privacy and ensure the necessary steps are taken to protect the privacy of its users throughout their visiting experience. This website complies with all Nigerian national laws and requirements for user privacy.</p>\r\n\r\n<p> </p>\r\n</div>\r\n\r\n<div>\r\n<h2>Use of Cookies</h2>\r\n\r\n<p>This website uses cookies to better the users experience while visiting the website. Where applicable this website uses a cookie control system allowing the user on their first visit to the website to allow or disallow the use of cookies on their computer / device. This complies with recent legislation requirements for websites to obtain explicit consent from users before leaving behind or reading files such as cookies on a user’s computer / device.</p>\r\n\r\n<p>Cookies are small files saved to the user’s computer’s hard drive that track, save and store information about the user’s interactions and usage of the website. This allows the website, through its server to provide the users with a tailored experience within this website.</p>\r\n\r\n<p>Users are advised that if they wish to deny the use and saving of cookies from this website on to their computers hard drive they should take necessary steps within their web browsers security settings to block all cookies from this website and its external serving vendors.</p>\r\n\r\n<p> </p>\r\n\r\n<p>This website uses tracking software to monitor its visitors to better understand how they use it. This software is provided by Google Analytics which uses cookies to track visitor usage. The software will save a cookie to your computer’s hard drive in order to track and monitor your engagement and usage of the website, but will not store, save or collect personal information.</p>\r\n\r\n<p> </p>\r\n</div>\r\n\r\n<div>\r\n<h2>Email Newsletter</h2>\r\n\r\n<p>This website operates an email newsletter program, used to inform subscribers about products and services supplied by this website. Users can subscribe through an online automated process should they wish to do so but do so at their own discretion. Some subscriptions may be manually processed through prior written agreement with the user.</p>\r\n\r\n<p>Email marketing campaigns published by this website or its owners may contain tracking facilities within the actual email. Subscriber activity is tracked and stored in a database for future analysis and evaluation. Such tracked activity may include; the opening of emails, forwarding of emails, the clicking of links within the email content, times, dates and frequency of activity [this is by no far a comprehensive list].</p>\r\n\r\n<p>This information is used to refine future email campaigns and supply the user with more relevant content based around their activity.</p>\r\n\r\n<p>Users are given the opportunity to un-subscribe at any time through an automated system. This process is detailed at the footer of each email campaign. If an automated un-subscription system is unavailable clear instructions on how to un-subscribe will by detailed instead.</p>\r\n\r\n<p><strong>When do we collect information?</strong></p>\r\n\r\n<p>We collect information from you when you register on our site, place an order, subscribe to a newsletter, Use Live Chat, Open a Support Ticket or enter information on our site.</p>\r\n\r\n<p> </p>\r\n</div>\r\n\r\n<div>\r\n<h2>External Links</h2>\r\n\r\n<p>Although this website only looks to include quality, safe and relevant external links, users are advised adopt a policy of caution before clicking any external web links mentioned throughout this website</p>\r\n\r\n<p>The owners of this website cannot guarantee or verify the contents of any externally linked website despite their best efforts. Users should therefore note they click on external links at their own risk and this website and its owners cannot be held liable for any damages or implications caused by visiting any external links mentioned.</p>\r\n\r\n<p>Adverts and Sponsored Links</p>\r\n\r\n<p>This website may contain sponsored links and adverts. These will typically be served through our advertising partners, to whom may have detailed privacy policies relating directly to the adverts they serve</p>\r\n\r\n<p>Clicking on any such adverts will send you to the advertiser’s website through a referral program which may use cookies and will track the number of referrals sent from this website. This may include the use of cookies which may in turn be saved on your computer’s hard drive. Users should therefore note they click on sponsored external links at their own risk and this website and its owners cannot be held liable for any damages or implications caused by visiting any external links mentioned.</p>\r\n\r\n<p> </p>\r\n</div>\r\n\r\n<div>\r\n<h2>Social Media Platforms</h2>\r\n\r\n<p>Communication, engagement and actions taken through external social media platforms that this website and its owners participate on are custom to the terms and conditions as well as the privacy policies held with each social media platform respectively.</p>\r\n\r\n<p>Users are advised to use social media platforms wisely and communicate / engage upon them with due care and caution in regard to their own privacy and personal details. This website nor its owners will ever ask for personal or sensitive information through social media platforms and encourage users wishing to discuss sensitive details to contact them through primary communication channels such as by telephone or email.</p>\r\n\r\n<p>This website may use social sharing buttons which help share web content directly from web pages to the social media platform in question. Users are advised before using such social sharing buttons that they do so at their own discretion and note that the social media platform may track and save your request to share a web page respectively through your social media platform account.</p>\r\n\r\n<p> </p>\r\n</div>\r\n\r\n<div>\r\n<h2>Shortened Links in Social Media</h2>\r\n\r\n<p>This website and its owners through their social media platform accounts may share web links to relevant web pages. By default some social media platforms shorten lengthy urls [web addresses]</p>\r\n\r\n<p>Users are advised to take caution and good judgement before clicking any shortened urls published on social media platforms by this website and its owners. Despite the best efforts to ensure only genuine urls are published many social media platforms are prone to spam and hacking and therefore this website and its owners cannot be held liable for any damages or implications caused by visiting any shortened links.</p>\r\n\r\n<p> </p>\r\n</div>\r\n\r\n<div>\r\n<h2>Security</h2>\r\n\r\n<p>Your personal information is contained behind secured networks and is only accessible by a limited number of persons who have special access rights to such systems, and are required to keep the information confidential. In addition, all sensitive information you supply is encrypted via Secure Socket Layer (SSL) technology.</p>\r\n\r\n<p>Our website is scanned on a regular basis for security holes and known vulnerabilities in order to make your visit to our site as safe as possible</p>\r\n\r\n<p>We use regular Malware Scanning.</p>\r\n\r\n<p>We implement a variety of security measures when a user enters, submits, or accesses their information to maintain the safety of your personal information.</p>\r\n\r\n<p> </p>\r\n</div>\r\n\r\n<div> </div>\r\n</div>\r\n</div>\r\n', 'Privacy Policy', 'Privacy Policy', 'Privacy Policy', '', '0', 'Publish', 98, '2014-10-01 19:54:03', '2018-06-09 09:34:52'),
                                                                                                                                                                                                                                       (182, 2, 0, 'page', 'About us', 'About us', 'about-us', '<div class=\"\">\r\n<div class=\"col-md-12 page-banner\">\r\n<div class=\"col-md-5 page-banner-content\">\r\n<h1>About Us</h1>\r\n\r\n<p>carquest is one of the Nigeria’s leading digital automotive marketplace</p>\r\n\r\n<p>We sit at the heart of the Nigeria’s vehicle and parts buying process ,this enable us to operate as one of the Nigeria’s largest digital automotive marketplace.</p>\r\n</div>\r\n\r\n<div class=\"clearfix\"> </div>\r\n</div>\r\n\r\n<div class=\"clearfix\"> </div>\r\n\r\n<div class=\"page-content\">\r\n<hr>\r\n<div class=\"col-md-7\">\r\n<h2>Our primary activity</h2>\r\n\r\n<p>is to help vehicle retailers and parts to compete effectively in the marketplace in order to sell more vehicles, faster and cheaper. The marketplace brings together engaged consumer audience, with the pool of vehicle sellers, listing various cars each day.</p>\r\n\r\n<p>carquest do not buy or sell any vehicles itself.</p>\r\n</div>\r\n\r\n<div class=\"col-md-5\"><img src=\"assets/theme/images/about-inner1.jpg\"></div>\r\n\r\n<div class=\"clearfix\"> </div>\r\n\r\n<hr>\r\n<div class=\"col-md-5\"><img src=\"assets/theme/images/about-inner3.jpg\"></div>\r\n\r\n<div class=\"col-md-7\">\r\n<h2>Our market-leading</h2>\r\n\r\n<p>position enables us to generate and collect large amounts of data on the Nigeria’s automotive marketplace and leverage our possession of such data to create a suite of products which helps retailers.</p>\r\n</div>\r\n\r\n<div class=\"clearfix\"> </div>\r\n</div>\r\n</div>', 'About us', 'About us  ', 'About us', '', '0', 'Publish', 0, '2016-08-04 19:20:48', '2017-02-01 09:47:48'),
