(187, 2, 0, 'page', 'TERMS AND CONDITIONS | CarQuest', 'TERMS AND CONDITIONS | CarQuest', 'terms-and-conditions', '<div>\r\n<div>\r\n<div>\r\n<h2>Terms and Conditions</h2>\r\n</div>\r\n\r\n<div><img src=\"assets/theme/images/termslogo.png\"></div>\r\n\r\n<div> </div>\r\n</div>\r\n\r\n<div> </div>\r\n</div>\r\n\r\n<div>\r\n<h3>Please read these Terms of Use carefully before using the Site.</h3>\r\n\r\n<h4>Introduction</h4>\r\n\r\n<p>These terms and conditions of use (“Terms of Use”) apply to this website and any other associated websites owned and operated by PerfectEdge Technologies in Nigeria or any of its subsidiary companies (together being the “Site”).</p>\r\n\r\n<p>These Terms of Use set out the terms on which you may make use of the Site, whether as a guest or a registered user, each time you use the Site. Use of the Site includes accessing, browsing, or registering to use the Site.</p>\r\n\r\n<p>Please read these Terms of Use carefully before you start to use the Site. We recommend that you print a copy of this for future reference. By using the Site, you agree to these Terms of Use and that you will comply with them. If you do not agree to these Terms of Use, you should not use any part of the Site.</p>\r\n\r\n<h4>1. Other Relevant Terms</h4>\r\n\r\n<p>1.1 These Terms of Use refer to the following additional terms, which also apply to your use of the Site:</p>\r\n\r\n<p>(a) <strong>Our Privacy Policy</strong>, which sets out the terms on which we process any personal data we collect from you; or that you provide to us and information about the cookies on the Site. By using the Site, you consent to such processing and you warrant that all data provided by you is accurate.</p>\r\n(b) Our Acceptable Use Policy, which sets out the permitted uses and prohibited uses of the Site. When using the Site, you must comply with this Acceptable Use Policy.\r\n\r\n<h4>2. Changes to these Terms</h4>\r\n\r\n<p>2.1 We may revise these <strong>Terms of Use</strong> at any time