INSERT INTO `documents` VALUES (6,4975,'Required Documents To Place Cover','<ul>\r\n <li>\r\n <h3>Excess buyback included for vehicles above 3m</h3>\r\n </li>\r\n <li>\r\n <h3>Tracker installation for Vehicles above 3million Naira</h3>\r\n </li>\r\n</ul>\r\n','<ul>\r\n <li>\r\n <h3><small>PROOF OF OWNERSHIP</small></h3>\r\n </li>\r\n <li>\r\n <h3><small>PICTURES OF THE VEHICLE</small></h3>\r\n </li>\r\n <li>\r\n <h3><small>VALID MEANS OF ID</small></h3>\r\n </li>\r\n <li>\r\n <h3><small>VEHICLE LICENSE</small></h3>\r\n </li>\r\n</ul>\r\n','<ul>\r\n <li>\r\n <h3>3rd party property damage</h3>\r\n </li>\r\n <li>\r\n <h3>Fire</h3>\r\n </li>\r\n <li>\r\n <h3>Theft</h3>\r\n </li>\r\n <li>\r\n <h3>Accidental damage</h3>\r\n </li>\r\n <li>\r\n <h3>Unlimited cover for bodily injury or death of third party and the insured.</h3>\r\n </li>\r\n <li>\r\n <h3>Towing (Limited)</h3>\r\n </li>\r\n</ul>\r\n','','','insurance','2020-09-19 14:11:07','2020-09-27 21:48:12'),(11,4976,'Required Details For Use','<ul>\r\n <li>\r\n <h3>Excess buyback included for vehicles above 3m Naira and above</h3>\r\n </li>\r\n <li>\r\n <h3>Tracker installation for Vehicles above 5million Naira</h3>\r\n </li>\r\n</ul>\r\n','<ul>\r\n <li>\r\n <h3>Vehicle License</h3>\r\n </li>\r\n <li>\r\n <h3>Proof Of Ownership</h3>\r\n </li>\r\n <li>\r\n <h3>Valid means of I.D</h3>\r\n </li>\r\n <li>\r\n <h3>Pictures of the Vehicle </h3>\r\n </li>\r\n</ul>\r\n','<ul>\r\n <li>\r\n <h3>3rd party property damage</h3>\r\n </li>\r\n <li>\r\n <h3>Fire</h3>\r\n </li>\r\n <li>\r\n <h3>Theft</h3>\r\n </li>\r\n <li>\r\n <h3>Accidental damage</h3>\r\n </li>\r\n <li>\r\n <h3>Unlimited cover for bodily injury or death of third party and the insured.</h3>\r\n </li>\r\n <li>\r\n <h3>Towing (Limited)</h3>\r\n </li>\r\n</ul>\r\n','','','insurance','2020-09-25 10:45:47','2020-09-27 22:21:54'),(12,4977,'Required Details For Use','<ul>\r\n <li>\r\n <h3> Excess buyback included for vehicles above 3m and above</h3>\r\n </li>\r\n <li>\r\n <h3>Tracker installation for Vehicles above 5million Naira</h3>\r\n </li>\r\n</ul>\r\n','<ul>\r\n <li>\r\n <h3><small>PROOF OF OWNERSHIP</small></h3>\r\n </li>\r\n <li>\r\n <h3><small>PICTURES OF THE VEHICLE</small></h3>\r\n </li>\r\n <li>\r\n <h3><small>VALID MEANS OF ID</small></h3>\r\n </li>\r\n <li>\r\n <h3><small>VEHICLE LICENSE</small></h3>\r\n </li>\r\n</ul>\r\n','<h3><strong>Scope of Cover</strong></h3>\r\n\r\n<ul>\r\n <li>\r\n <h3>3rd party property damage</h3>\r\n </li>\r\n <li>\r\n <h3>Fire</h3>\r\n </li>\r\n <li>\r\n <h3>Theft</h3>\r\n </li>\r\n <li>\r\n <h3>Accidental damage</h3>\r\n </li>\r\n <li>\r\n <h3>Unlimited cover for bodily injury or death of third party and the insured.</h3>\r\n </li>\r\n <li>\r\n <h3>Towing (Limited)</h3>\r\n </li>\r\n</ul>\r\n','','','insurance','2020-09-25 12:57:00','2020-09-27 22:09:18'),(13,4978,'Required Details For Use','<ul>\r\n <li>\r\n <h3>This policy covers 3rd party property damage and bodily injury caused by motor accident up to a limit of 1million Naira.</h3>\r\n </li>\r\n</ul>\r\n','<ul>\r\n <li>\r\n <h3>Vehicle License</h3>\r\n </li>\r\n <li>\r\n <h3>Proof Of Ownership</h3>\r\n </li>\r\n <li>\r\n <h3>Valid means of I.D</h3>\r\n </li>\r\n <li>\r\n <h3>Pictures of the Vehicle</h3>\r\n </li>\r\n</ul>\r\n','<ul>\r\n <li>\r\n <h3>   N1 million cover limit on 3rd party property damage</h3>\r\n </li>\r\n <li>\r\n <h3>   Unlimited cover for bodily injury or death of third party</h3>\r\n </li>\r\n</ul>\r\n','','<ul>\r\n <li>\r\n <h3>      Registration Number</h3>\r\n </li>\r\n <li>\r\n <h3>      Chassis Number</h3>\r\n </li>\r\n <li>\r\n <h3>      Name of Maker</h3>\r\n </li>\r\n <li>\r\n <h3>      Model</h3>\r\n </li>\r\n <li>\r\n <h3>      Color</h3>\r\n </li>\r\n <li>\r\n <h3>      Year of Manufacturing</h3>\r\n </li>\r\n</ul>\r\n','insurance','2020-09-27 13:43:22','2020-09-27 21:41:53');
