INSERT INTO `email_templates` VALUES (1,'Welcome to CarQuest','<p>Dear %user_name%</p>\r\n\r\n<p>Welcome to CarQuest,</p>\r\n\r\n<p>We&#39;re happy to confirm you&#39;ve successfully registered with us.</p>\r\n\r\n<p><br>\r\nBelow are your login details<br>\r\nUsername: %username%<br>\r\nPassword: %password%<br>\r\nURL: <a href=\"%url%\" target=\"_blank\">%url%</a></p>\r\n\r\n<p>Regards,</p>\r\n\r\n<p>CarQuest Team</p>\r\n\r\n<p> </p>\r\n\r\n<p><a href=\"https://www.facebook.com/\">Like us on facebook</a></p>\r\n\r\n<p><a href=\"https://twitter.com/\">Follow us on twitter</a></p>\r\n\r\n<p><a href=\"https://www.instagram.com/\">Follow us on Instagram</a></p>\r\n\r\n<p><a href=\"https://www.youtube.com/channel/UCmyfx9PyVYxg8G1N0hkabjQ\">Subscribe to our youtube channel</a></p>\r\n\r\n<p><em>Warning :</em></p>\r\n\r\n<p><em>Always exercise caution and due diligence before making payment<br>\r\n Do not send money to a seller without checking vehicle.<br>\r\n Beware of unusually low price & mileage.<br>\r\n Request to send money before delivering the vehicle is usually scam</em></p>\r\n\r\n<p> </p>\r\n\r\n<p> Please note that buying and selling of cars is the sole responsibility of buyers and sellers</p>','onRegistrationNewBuyer','Locked','When new buyer register then send welcome mail ','0000-00-00','2025-05-12 05:48:23'),(2,'Welcome to CarQuest','<p>Dear %user_name%</p>\r\n\r\n<p>Welcome to CarQuest,<br>\r\nYou have successfully created an account.<br>\r\nBelow are your login details</p>\r\n\r\n<p><br>\r\nUsername: %username% <br>\r\nPassword: %password%<br>\r\nURL: %url%</p>\r\n\r\n<p>Dont just sit there... list your autoproducts for sale now and get the<br>\r\nbest deal from customers in minutes..<br>\r\nWe&#39;ve got amazing tool guide to help you make your autoproduct sell fast..<br>\r\nEvery 60 seconds someone chooses to buy. Sell your product now!</p>\r\n\r\n<p>for advert cost please check our faq page or click the link below</p>\r\n\r\n<p><a href=\"https://carquest.com/faq\">https://carquest.com/faq </a></p>\r\n\r\n<p>Regards,</p>\r\n\r\n<p>CarQuest Team</p>\r\n\r\n<p>94A,Allen Avenue,Ikeja,Lagos</p>\r\n\r\n<p><a href=\"https://www.facebook.com/\">Like us on facebook</a></p>\r\n\r\n<p><a href=\"https://twitter.com/\">Follow us on twitter</a></p>\r\n\r\n<p><a href=\"https://www.instagram.com/\">Follow us on Instagram</a></p>\r\n\r\n<p><a href=\"https://www.youtube.com/channel/UCmyfx9PyVYxg8G1N0hkabjQ\">Subscribe to our youtube channel</a></p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n\r\n<p>Warning :</p>\r\n\r\n<p>Always exercise caution and due diligence before making payment<br>\r\n Do not send money to a seller without checking vehicle.<br>\r\n Beware of unusually low price & mileage.<br>\r\n Request to send money before delivering the vehicle is usually scam</p>\r\n\r\n<p> </p>\r\n\r\n<p>Please note that buying and selling of cars is the sole responsibility of buyers and sellers</p>\r\n\r\n<p> </p>','onRegistrationPrivateSeller','Locked','When new private seller register then send welcome mail ','0000-00-00','2025-05-12 05:50:04'),(3,'Welcome to CarQuest','<p>Dear %user_name%</p>\r\n\r\n<p>Thank you very much for registering with us.<br>\r\nWe are happy to have you join our amazing dealers.</p>\r\n\r\n<p>Below are your login details<br>\r\nUsername: %username% <br>\r\nPassword: %password%<br>\r\nURL: %url%</p>\r\n\r\n<p>Dont just sit there...explore.<br>\r\nWe&#39;ve got amazing tool guide to help you make your company page a<br>\r\nnon-stop for customers.<br>\r\nEvery 60 seconds someone chooses to buy. Sell your product now!</p>\r\n\r\n<p>for advert cost please check our faq page or click the link below</p>\r\n\r\n<p><a href=\"https://carquest.com/faq\">https://carquest.com/faq</a></p>\r\n\r\n<p>Regards,</p>\r\n\r\n<p>CarQuest Team</p>\r\n\r\n<p> </p>\r\n\r\n<p>Warning :</p>\r\n\r\n<p> Always exercise caution and due diligence before making payment<br>\r\n Do not send money to a seller without checking vehicle.<br>\r\n Beware of unusually low price & mileage.<br>\r\n Request to send money before delivering the vehicle is usually scam</p>\r\n\r\n<p> </p>\r\n\r\n<p>Please note that buying and selling of cars is the sole responsibility of buyers and sellers</p>\r\n\r\n<p> </p>','onRegistrationTradeSeller','Locked','When new Trade Seller register then send welcome mail ','0000-00-00','2025-05-12 05:50:45'),(4,'CarQuest - Your post under reveiw','<p>Dear %seller%</p>\r\n\r\n<p>Thank you for chosing CarQuest,your listing has been successfully created.<br>\r\nWe will review and publish your listing as soon as possible, please do make payment to any of the account below.</p>\r\n\r\n<p>Account name :CarQuest Technologies Limited</p>\r\n\r\n<p>Account Number :0088265664</p>\r\n\r\n<p>Bank :Diamond Bank Plc</p>\r\n\r\n<p>Account Name: CarQuest Technologies Ltd</p>\r\n\r\n<p>Account Number: 2030717208</p>\r\n\r\n<p>Kindly  email confirmation/receipt to <a href=\"mailto:payment@carquest.com\">payment@carquest.com</a>.<br>\r\nYour listing will be active on the website within 24hrs of the receive<br>\r\nof receipt/confirmation.<br>\r\nOR<br>\r\n<br>\r\nYou can make payment at our office for immediate activation at<br>\r\nPERFEECT EDGE TECHNOLOGIES<br>\r\n94A, ALLEN AVENUE<br>\r\nIKEJA, LAGOS.</p>\r\n\r\n<p><br>\r\nIf you have already made payment, not to worry, your listing will be<br>\r\npublished soon.</p>\r\n\r\n<p>Regards,</p>\r\n\r\n<p>CarQuest Team</p>','onPostNewAdvert','Locked','When someone post new vehicle send him thank you email ','0000-00-00','2025-05-12 05:51:28'),(5,'CarQuest - Your listing is activated','<p>Dear %seller%</p>\r\n\r\n<p>Your listing is now active and live on the website.</p>\r\n\r\n<p>Please click on the link below to view.</p>\r\n\r\n<p>Preview link: %link%</p>\r\n\r\n<p>If you have any questions or concerns, please do not hesitate to contact us.</p>\r\n\r\n<p>With Thanks,</p>\r\n\r\n<p>CarQuest Team</p>','onPostActivation','Locked','When a listing activated by admin/e