INSERT INTO `help` VALUES (2004,'How Much Do i Pay to List My cars','<blockquote><p></p><br><p><b>PRIVATE\r\n  SELLER PRICE-LIST</b></p>\r\n  \r\n \r\n \r\n  \r\n  <p><img width=\"141\" alt=\"\" src=\"https://s3-us-west-2.amazonaws.com/perfectedge/Picture/carn1.png\" height=\"141\"></p>\r\n  \r\n   \r\n    \r\n    <p><br></p>\r\n  \r\n \r\n \r\n  \r\n  <p><b>60 DAYS\r\n  PREMIUM LISTING- POPULAR  ( $2,500 per\r\n  car)</b></p>\r\n  \r\n \r\n \r\n  \r\n  <p> </p>\r\n  \r\n \r\n \r\n  \r\n  <p>* First\r\n  Page of search on each category for 60days</p>\r\n  \r\n \r\n \r\n  \r\n  <p>* 60\r\n  Days Activation ( car online for 60 days)</p>\r\n  \r\n \r\n \r\n  \r\n  <p>* Social\r\n  Media Adverts ( Facebook,Instagram and Twitter)</p>\r\n  \r\n \r\n \r\n  \r\n  <p>* Online\r\n  portal to chat with buyers</p>\r\n  \r\n \r\n \r\n  \r\n  <p>*\r\n  Email,Telephone Support and whatsapp support</p>\r\n  \r\n \r\n \r\n  \r\n  <p> </p>\r\n  \r\n \r\n \r\n  \r\n  <p><b>30 DAYS\r\n  PREMIUM LISTING  ($1,800 per car)</b></p>\r\n  \r\n \r\n \r\n  \r\n  <p> </p>\r\n  \r\n \r\n \r\n  \r\n  <p>* First\r\n  Page of search on each category for 30days</p>\r\n  \r\n \r\n \r\n  \r\n  <p>* 30\r\n  Days Activation ( car online for 30 days)</p>\r\n  \r\n \r\n \r\n  \r\n  <p>* Social\r\n  Media Adverts ( Facebook,Instagram and Twitter)</p>\r\n  \r\n \r\n \r\n  \r\n  <p>* Online\r\n  portal to chat with buyers</p>\r\n  \r\n \r\n \r\n  \r\n  <p>*\r\n  Email,Telephone Support and whatsapp support</p>\r\n  \r\n \r\n \r\n  \r\n  <p> </p>\r\n  \r\n \r\n \r\n  \r\n  <p><b>30 DAYS\r\n  BASIC LISTING ($1,000 per car)</b></p>\r\n  \r\n \r\n \r\n  \r\n  <p> </p>\r\n  \r\n \r\n \r\n  \r\n  <p>*\r\n  Activation for 30 days ( cars Online for 30days)</p>\r\n  \r\n \r\n \r\n  \r\n  <p>* Online\r\n  Portal to chat with buyers</p>\r\n  \r\n \r\n \r\n  \r\n  <p>* Email\r\n  Support</p>\r\n  \r\n \r\n \r\n  \r\n  <p> </p>\r\n  \r\n \r\n \r\n  \r\n  <p><b>60 DAYS\r\n  BASIC LISTINGS ($1,800 PER CAR)</b></p>\r\n  \r\n \r\n \r\n  \r\n  <p> </p>\r\n  \r\n \r\n \r\n  \r\n  <p>*\r\n  Activation for 60 days ( cars Online for 60days)</p>\r\n  \r\n \r\n \r\n  \r\n  <p>* Online\r\n  portal to chat with buyers</p>\r\n  \r\n \r\n \r\n  \r\n  <p>* Email\r\n  Support</p><small><u></u></small><p></p></blockquote>','','Published','Yes','2017-12-10','2025-05-12','','','No','0000-00-00'),(2005,'When do i pay, is it before or after sales,and how do i upload my car.','<p>Car activation payment has to be made before it is displayed on the website. However, you can list as much car as you want on your profile but it will not be active until payment has been received.</p><p>To sell your car, please register with us on the website and follow below steps.<br><br>1. Fill in your contact details by clicking My Account icon on the left corner of the dashboard, then click update.<br><br>2. Goto Post Advert, click on add post,and please fill in all your car details. Do make sure you click submit and continue.<br><br>3. You can click on the preview to see how your listing will be displayed on the website.<br><br>4. When payment is received, we will review and publish your advert within 24hrs of payment.<br></p>','','Published','Yes','2018-04-10','2018-04-12','Iloka Chinedu ','eduiloka@gmail.com','No','2018-04-10'),(2006,'hello sir/ ma, pld i have s benz 320 to sale,','I have jeep 2 sale how did I go about BBB it pla.','','Draft','No','2018-05-09','0000-00-00','tunde tonade','mujeedat4sure@gmail.com','No','2018-05-09'),(2007,'Mistake in Registration','Good Morning, <br>\r\n<br>\r\nMy name is Bkay, I registered on CarQuest few mins ago but mistaking I clicked on private owner instead of business.  <br>\r\n<br>\r\nI\'m a registered car dealer .  So I\'ve seen the payment options for a private seller.  <br>\r\n<br>\r\nI will like to request or know the payment options for the business classes too. <br>\r\n<br>\r\nI can see that private sellers are to pay per Car which I want to know if business classes are to pay for cars.  <br>\r\n<br>\r\nKindly educate me so that you could help me on how to migrate to business class','','Draft','No','2018-06-11','2025-05-12','Bkay','fatimo.p@yahoo.com','No','2018-06-11'),(2009,'What does it mean of premium and basic?','','','Draft','No','2018-11-30','0000-00-00','Omolona Oluwatosin Samson','tosinlona2000@gmail.com','No','2018-11-30'),(2010,'How can I post my product and can I post my product','','','Draft','No','2020-10-17','2020-10-17','chukwujindu nwokemodo','chukwujindunwokemodo6@gmail.com','No','2020-10-17'),(2011,'I want to register with your company so I can post my advert, but I find it difficult to do so.','','I need your help thanks Nelson.','Draft','No','2020-12-15','2020-12-15','Nelson Bamigboye','bamigboyenelson950@gmail.com','No','2020-12-15'),(2012,'How to past an ad','','Direct Tokunbo Toyota Corolla sport for sale','Draft','No','2021-10-05','2021-10-05','Peter','bamidelelucky1@gmail.com','No','2021-10-05');
