INSERT INTO `posts` VALUES (1,6351,0,3,'New','Personal','No','Fzs v2 black for sell','fzs-v2-black-for-sell','Yamaha FZ-S V2 Black Edition – a muscular and reliable street bike with a bold matte black finish. Powered by a 149cc fuel-injected engine, it offers smooth performance, great mileage, and excellent city handling. Features include digital instrument cluster, split seat, sporty tank design, front disc brake, and tubeless tyres. Lightweight and comfortable for daily use. Well-maintained and in great condition. Ideal for both new and experienced riders. Serious buyers only.',2,0,'Uratta',NULL,NULL,'NGR',NULL,2000,NULL,'2025-05-09','2025-06-09',45,2126,'2133',0,0,6,29,'',0,2,13,'2018-05-01',2017,'11142358',NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'General','',NULL,NULL,NULL,NULL,'Active',3,NULL,'2025-05-09 13:50:08','2025-05-13 07:37:37',NULL,'15 kda avenue, Uratta',81,NULL,NULL,0,0,0,NULL),(2,6351,0,3,'New','Personal','No','YZF-R1 Bike for sell','yzf-r1-bike-for-sell','Yamaha YZF-R1 – a legendary superbike built for speed, precision, and aggressive performance. Equipped with a powerful 998cc inline 4-cylinder engine, crossplane crankshaft technology, and advanced electronics including ride modes, traction control, quick shifter, and launch control. Sleek aerodynamic design with LED lights, TFT digital display, and premium suspension setup for ultimate handling and comfort. Ideal for superbike enthusiasts who demand top-tier performance. Well-maintained, excellent condition. Serious inquiries only.',2,0,'Umuola-Egbule',NULL,NULL,'NGR',NULL,88000,NULL,'2025-05-09','2025-06-09',25,2126,'2128',0,0,6,30,'',0,3,14,'2025-05-09',2024,'11112233',NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'General','',NULL,NULL,NULL,NULL,'Active',2,NULL,'2025-05-09 11:06:21','2025-05-12 12:03:10',NULL,'15 kda avenue',67,NULL,NULL,0,0,0,NULL),(3,6351,0,3,'New','Personal','No','GSX-R 150','gsx-r-150','The Suzuki GSX-R150 is a lightweight sportbike designed for entry-level riders and enthusiasts seeking a blend of performance, style, and agility. It is part of the GSX-R series, known for its racing heritage and sporty characteristics.',4,0,'Otoro',NULL,NULL,'NGR',NULL,5520,NULL,'2025-05-09','2025-06-09',35,2042,'2046',0,0,6,29,'',0,23,14,'2025-04-28',2022,'44557812',NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'General','',NULL,NULL,NULL,NULL,'Active',0,NULL,'2025-05-09 11:16:00','2025-05-12 11:01:20',NULL,'11 kda avenue, Otoro',58,NULL,NULL,0,0,0,NULL),(4,6351,0,3,'New','Personal','No','Honda CBR 150 Repsol','honda-cbr-150-repsol','Honda CBR 150R Repsol Edition – a stylish and performance-focused sport bike with race-inspired graphics and sharp aerodynamic design. Powered by a 149cc liquid-cooled engine with smooth 6-speed transmission, delivering great throttle response and fuel efficiency. Features include LED headlights, digital instrument cluster, sporty split seats, and disc brakes with ABS. Repsol Edition adds a bold racing look. Well-maintained, excellent condition, and perfect for daily commutes or weekend rides. Serious buyers only.',4,0,'Ediene',NULL,NULL,'NGR',NULL,5600,NULL,'2025-05-09','2025-06-09',38,1941,'1946',0,0,6,0,'',0,0,14,'2017-03-05',2019,'12457856',NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'General','',NULL,NULL,NULL,NULL,'Active',1,NULL,'2025-05-09 11:29:38','2025-05-12 11:01:20',NULL,'18 kda avenew uratta',63,NULL,NULL,0,0,0,NULL),(5,6351,0,3,'New','Personal','No','Bajaj Pulsar NS200','bajaj-pulsar-ns200','Bajaj Pulsar NS200 – a powerful and sporty street bike, perfect for daily rides and weekend thrills. Equipped with a 199.5cc liquid-cooled engine, delivering quick acceleration and great handling. Features include a 6-speed gearbox, front and rear disc brakes with ABS, muscular design, digital-analog meter, and aggressive headlamp styling. Well-maintained, smooth performance, and excellent mileage. Ideal for riders who want performance with style. Serious buyers only.',3,0,'Bille',NULL,NULL,'NGR',NULL,1245,NULL,'2025-05-09','